    <style>
        .container {
            display: grid;
            grid-template-columns: 22% 20% 58%;
            grid-template-rows: 15vh 26vh 18.5vh 25vh;
            margin-top: 5px;
            margin-bottom: 10px;
            gap: 5px;
            grid-auto-columns: 50px;
            grid-auto-rows: 100px;
        }
        .item {
            display: grid;
            border: 1px solid white;
            border-radius: 10px;
            background-color: lightblue;
            align-items: center;
            justify-content: center;
        }
        .el2 {
            display: flex;
            justify-content: end;
            grid-column-start: 2;
            grid-column-end: 4;
        }
        .el3 {
            grid-column-start: 1;
            grid-column-end: 3;
            grid-row: 2 / 4;
            width: 14rem;
            height: 16rem;
            border: 5px solid bisque;
        }
        .el4 {
            grid-column-start: 3;
            grid-column-end: 4;
            grid-row: 2 / 4;
            background-color: bisque;
        }
        .el5 {
            grid-row-start: 4;
            grid-row-end: 5;
            grid-column-start: 1;
            grid-column-end: 3;
        }
        .el6 {
            grid-row-start: 4;
            grid-row-end: 5;
            grid-column-start: 3;
            grid-column-end: 4;
        }
        .el8 {
            grid-column-start: 1;
            grid-column-end: -1;
        }
        .link {
            color: black;
            background-color: lightgoldenrodyellow;
        }
        .card {
            border-radius: 10px;
        }
    </style>
